// src/pages/ManageEvents.js
import React from 'react';

function ManageEvents({ role }) {
  return (
    <div className="manage-events">
      <h1>Gestión de Eventos</h1>
      {role === 'admin' ? (
        <div>
          <h2>Administrar eventos y capacitaciones</h2>
          {/* Aquí puedes agregar los elementos de gestión de eventos */}
        </div>
      ) : (
        <div>
          <h2>Ver eventos y capacitaciones</h2>
          {/* Aquí puedes agregar los elementos que los clientes pueden ver */}
        </div>
      )}
    </div>
  );
}

export default ManageEvents;
